$(document).ready(function(){$("a.fileURL").click(function(){var a=$(this).attr("href");var b=tinyMCEPopup.getWindowArg("window");b.document.getElementById(tinyMCEPopup.getWindowArg("input")).value=a;if(typeof(b.ImageDialog)!="undefined"){if(b.ImageDialog.getImageData){b.ImageDialog.getImageData()}if(b.ImageDialog.showPreviewImage){b.ImageDialog.showPreviewImage(a)}}tinyMCEPopup.close();return false})});